class Solution:
    def find132pattern(self, nums: list[int]) -> bool:


        stack = []
        maxmid = float("-inf")

        for i in nums[::-1]:
            if i < maxmid:
                return True
            while stack and stack[-1] < i:
                maxmid = stack.pop()
            stack.append(i)
        return False


